import React from 'react';
import Todo from './Todo';


const TodoList = (props) => {

    return(
        <div className = 'todo-list'>
            {props.todo_collection.map(item =>(
                <Todo key={item.id} task={item}/>
            ))}

        </div>
    )
}

 export default TodoList;
